import styled from "styled-components";
import { useEffect } from "react";
import withAuth from "../lib/interface/withAuth";
import { Layout, Modal, Button, Heading, Form } from "../lib/components";
import { Nav, User_Overview } from "../lib/blocks";

const { Body, Container, Wrapper } = Layout;

const Dash_Body = styled(Body)`
  background-color: #3e4a4a;

  .Dash_Overview {
    background-color: #6d6d6d;
    padding-top: 1em;
    padding-bottom: 1em;
    display: flex;
  }

  .Dash_View {
    display: flex;
    .Dash_View_Nav {
      display: flex;
      flex-direction: column;
      position: relative;
      border-right: 1px solid #d8d8d8;

      .Dash_View_Nav_Caption {
        color: black;
        padding-top: 3em;
        padding-bottom: 3em;
        font-size: 0.5em;
        & > * {
          padding: 0;
          margin: 0;
        }
      }

      .Dash_View_Nav_Controlls {
        height: 100%;
        width: 100%;
      }
    }
    .Dash_View_SubContainer {
      height: 100%;
      width: 100%;
      background-color: #eaeafb;
    }
  }
`;

const Dash = ({ user }) => {
  const { firstName, lastName } = user;
  //Quick fix for overflow bug on __next element
  useEffect(() => {
    const tag = document.getElementById("__next");
    tag.style.height = "100vh";
    tag.style.overflow = "hidden";
  }, []);

  return (
    <Dash_Body>
      <Nav isLoggedIn={user} show={true} />
      <User_Overview name={firstName + " " + lastName} {...user} />
      <Wrapper className="Dash_View">
        <Modal className="Dash_View_Nav" type="left" show={true}>
          <div className="Dash_View_Nav_Caption">
            <Heading>Parent</Heading>
            <Heading>Dash</Heading>
          </div>
          <div className="Dash_View_Nav_Controlls">
            <Button type="Small">Billing</Button>
          </div>
        </Modal>

        <Container className="Dash_View_SubContainer"></Container>
      </Wrapper>
    </Dash_Body>
  );
};

export default withAuth(Dash, <div>content</div>);
